import React from 'react';
import { render } from 'react-dom';
import { Layout ,  Row, Col, Breadcrumb , Select,Form} from 'antd';
import 'antd/dist/antd.css';
import './index.css';

const { Header, Footer, Sider, Content } = Layout;
const { Option } = Select;
const layout = {
  labelCol: {
    span: 8,
  },
  wrapperCol: {
    span: 16,
  },
};

function onChange(value) {
  console.log(`selected ${value}`);
}

function onBlur() {
  console.log('blur');
}

function onFocus() {
  console.log('focus');
}

function onSearch(val) {
  console.log('search:', val);
}

const App = () => {
  return (
    <Layout>
    <Header>Header</Header>
    <Layout>
      <Sider>Sider</Sider>
      <Content>
      <Row style={{ padding: '0 24px 24px', backgroundColor: '#ffffff'}}>
      <Col span={24}><h1>ส่งออกข้อมูล</h1></Col>
      </Row>
      <Row style={{ margin: '24px 24px 24px 24px', backgroundColor: '#ffffff'}}>
          <Col span={24}>
          <Breadcrumb style={{ backgroundColor: '#ffffff'}}>
            <Breadcrumb.Item>หน้าหลัก</Breadcrumb.Item>
            <Breadcrumb.Item>ผู้ดูแลระบบ</Breadcrumb.Item>
            <Breadcrumb.Item>ส่งออกข้อมูล</Breadcrumb.Item>
          </Breadcrumb>
          </Col>
          <Col span={24}>
          <Form {...layout}  name="control-hooks" >
          <Form.Item
            name="gender"
            label="Gender"
            rules={[
              {
                required: true,
              },
            ]}
          >
          <Select
            showSearch
            style={{ width: 300 }}
            placeholder="Select a person"
            optionFilterProp="children"
            onChange={onChange}
            onFocus={onFocus}
            onBlur={onBlur}
            onSearch={onSearch}
            filterOption={(input, option) =>
              option.children.toLowerCase().indexOf(input.toLowerCase()) >= 0
            }
          >
            <Option value="jack">E-Learning Upload Template (Report)</Option>
          </Select>
          </Form.Item>
          </Form>
          </Col>
      </Row>
      </Content>
    </Layout>
    <Footer>Footer</Footer>
    </Layout>
  );
};

render(<App />, document.getElementById('root'));
